import React from 'react';

import bagImage from '../../image/bag.webp';
import classes from './ordersEmpty.module.css';

function OrdersEmpty(props){
    return(
        <div className={classes.emptyOrder}>
            <img src = {bagImage} alt = "Bag"  className={classes.orderImg}></img>
            <p>Your bag is empty</p>
            <p className={classes.subHead}>Let's add some items</p>
            <button type='button' onClick={toHome}>SHOP NOW</button>
        </div>
    );
}

export default OrdersEmpty;
